import React from 'react';
import { Box, Container, Typography, Grid, Paper, Button, Stack } from '@mui/material';
import GitHubIcon from '@mui/icons-material/GitHub';
import LaunchIcon from '@mui/icons-material/Launch';

const projects = [
  {
    title: 'Conv-AI Medical Chatbot',
    description: "A conversational AI chat-bot aiming to provide diagnoses for less priviledged society developed by Finetuning LLM's such as Llama, GPT.",
    github: 'https://github.com/hruday-tej/conv-ai-medical-chatbot',
    demo: 'https://demo-link.com',
  },
  {
    title: 'Clinical Text Summarizer',
    description: 'A Large Language Model Fine-tuned to perform the task of Text Summarization of clinical history of patients, contrasted by the efficiencies of LSTM and BERT.',
    github: 'https://github.com/hruday-tej/clinical-text-summarizer',
    demo: 'https://demo-link.com',
  },
  {
    title: 'Single Image Super Resolution',
    description: 'A GAN Model developed to enhance the quality of degraded images by an upscaling factor of 4, contrasted by the performance of CNN and image interpolation.',
    github: 'https://github.com/hruday-tej/single-image-super-resolution',
    demo: 'https://demo-link.com',
  },
];

const Projects = () => (
  <Box id="projects" sx={{ py: 10, bgcolor: 'background.default' }}>
    <Container maxWidth="lg">
      <Box sx={{ display: 'flex', justifyContent: 'flex-end', mb: 2 }}>
        <Box>
          <Typography variant="body1" sx={{ color: '#555', fontWeight: 500, textAlign: 'right' }}>
            Browse My Recent
          </Typography>
          <Typography variant="h2" sx={{ fontWeight: 700, textAlign: 'right', fontSize: 36 }}>
            Projects
          </Typography>
        </Box>
      </Box>
      <Grid container spacing={4} justifyContent="center">
        {projects.map((project, index) => (
          <Grid item xs={12} md={4} key={index}>
            <Paper
              sx={{
                borderRadius: 6,
                border: '2px solid #e0e0e0',
                p: 4,
                height: '100%',
                background: '#fff',
                boxShadow: 'none',
                display: 'flex',
                flexDirection: 'column',
                alignItems: 'center',
              }}
            >
              <Typography variant="h5" sx={{ fontWeight: 700, mb: 1, textAlign: 'center' }}>
                {project.title}
              </Typography>
              <Typography variant="body1" sx={{ color: '#222', mb: 3, textAlign: 'center' }}>
                {project.description}
              </Typography>
              <Stack direction="row" spacing={2} sx={{ justifyContent: 'center', width: '100%' }}>
                <Button
                  startIcon={<GitHubIcon />}
                  href={project.github}
                  target="_blank"
                  rel="noopener noreferrer"
                  sx={{
                    borderRadius: 999,
                    px: 3,
                    fontWeight: 600,
                    border: '2px solid #111',
                    color: '#111',
                    background: '#fff',
                    boxShadow: 'none',
                    '&:hover': { background: '#f5f5f5', borderColor: '#111' },
                  }}
                >
                  Github
                </Button>
                <Button
                  startIcon={<LaunchIcon />}
                  href={project.demo}
                  target="_blank"
                  rel="noopener noreferrer"
                  sx={{
                    borderRadius: 999,
                    px: 3,
                    fontWeight: 600,
                    background: '#222',
                    color: '#fff',
                    boxShadow: 'none',
                    '&:hover': { background: '#111' },
                  }}
                >
                  Live Demo
                </Button>
              </Stack>
            </Paper>
          </Grid>
        ))}
      </Grid>
    </Container>
  </Box>
);

export default Projects;
